Writer:  Karl Kesel (#4-7) and Steve Mattsson (#6)
Penciller:  Tom Grummett (#4-7), Mike Parobeck (#4)
Inker:  Doug Hazelwood (#4-7), Ande Parks (#4), and Dennis Janke (#6)
Colorist:  Tom McCraw
Letterers:  Richard Starkings
Covert Artists:  Tom Grummett (#4-7), Mike Parobeck (#4), and Karl Kesel (#4-7)

Superboy #4
Two Superboy adventures take place simultaneously! On the Boy of Steel's very own cartoon show, he must face off with the dastardly duo of Lock 'n' Lode. Meanwhile in the real world, Superboy may be succumbing to a disease that seems to have deadly effects on clones.

Superboy #5
Superboy is suffering from the effects of the Clone-Plague. This leaves him in no shape to face the new threat of Silver Sword.

Superboy #6
Superboy must face his biggest challenge yet when he goes toe-to-toe with the Parasite, a creature that has almost killed the Man of Steel on several occasions. Plus, Superboy meets Fred Bentson from the Milestone Universe!

Superboy #7
Guest-starring Superman, Icon, Rocket, and Static. Superboy, Rocket, and Static must team-up to take done Rift. Even if they succeed a universe still may die!

